import BlueDice1 from './assets/dice-blue-1.svg';
import RedDice1 from './assets/dice-red-1.svg';

const dice = {
    blue : BlueDice1,
    red : RedDice1,
};

function Dice( {color} ) {
    const src = dice[color];
    return <img src={src} alt={'주사위'} />   
}

export default Dice;
